import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { UserService, ProfileData } from '../services/user.service';

@Component({
  selector: 'app-profile',
  templateUrl: './profile.component.html',
  styleUrls: ['./profile.component.css']
})
export class ProfileComponent implements OnInit {
  isRegistering = false;

  username = '';
  password = '';

  userProfile: ProfileData = {
    username: '',
    skinType: '',
    skinTone: '',
    hairColor: '',
    eyeColor: ''
  };

  // רשימות לבחירה – כמו ב-QUIZ
  skinTypes = ['Dry', 'Oily', 'Normal', 'Combination'];
  skinTones = ['Light', 'Medium', 'Dark'];
  hairColors = ['Brown', 'Black', 'Blonde', 'Red'];
  eyeColors  = ['Brown', 'Green', 'Blue', 'Gray'];

  constructor(private router: Router, public userService: UserService) {}

  ngOnInit(): void {
    const username = this.userService.getLoggedInUser();
    if (username) {
      const cachedProfile = this.userService.getProfileData();
      if (cachedProfile) {
        this.userProfile = { ...cachedProfile };
      } else {
        this.userService.fetchProfile(username).subscribe({
          next: (profile) => this.userProfile = { ...profile },
          error: () => this.userProfile.username = username
        });
      }
    }
  }

  login(): void {
    this.userService.login({ username: this.username, password: this.password }).subscribe({
      next: (response: any) => {
        const username = response.user.username;
        this.userService.setLoggedInUser(username);

        this.userService.fetchProfile(username).subscribe({
          next: (profile) => {
            this.userProfile = { ...profile };
            alert('Login successful!');
          },
          error: () => {
            this.userProfile = { username, skinType: '', skinTone: '', hairColor: '', eyeColor: '' };
            alert('Login successful!');
          }
        });
      },
      error: (err: any) => alert(err.error?.error || 'Login failed')
    });
  }

  register(): void {
    this.userService.register({ username: this.username, password: this.password }).subscribe({
      next: () => {
        alert('Registration successful!');
        this.isRegistering = false;
      },
      error: (err: any) => alert(err.error?.error || 'Registration failed')
    });
  }

  saveProfile(): void {
    const username = this.userService.getLoggedInUser();
    if (!username) {
      alert('User not logged in');
      return;
    }

    const profileData: ProfileData = { ...this.userProfile, username };

    this.userService.saveProfile(profileData).subscribe({
      next: () => {
        alert('Profile saved successfully!');
        this.userService.setProfile(profileData);
      },
      error: (err: any) => alert(err.error?.error || 'Failed to save profile')
    });
  }

  logout(): void {
    this.userService.logout();
    alert('You have been logged out!');
    this.router.navigate(['/register']);
  }

  goToQuiz(): void {
    this.router.navigate(['/quiz']);
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Profile page</title>
  <link rel="stylesheet" href="profile.component.css" />
</head>
<body>
  <header>
    <a [routerLink]="['/']">
      <img src="assets/logo.jpg" alt="Logo" class="logo" />
    </a>
  </header>

  <!-- Login Section -->
  <div *ngIf="!userService.getLoggedInUser() && !isRegistering">
    <h2>Login</h2>
    <form (ngSubmit)="login()">
      <label for="login-username">Username:</label>
      <input type="text" id="login-username" [(ngModel)]="username" name="username" required />

      <label for="login-password">Password:</label>
      <input type="password" id="login-password" [(ngModel)]="password" name="password" required />

      <button type="submit">Login</button>
    </form>
    <button (click)="isRegistering = true">Register</button>
  </div>

  <!-- Register Section -->
  <div *ngIf="isRegistering">
    <h2>Register</h2>
    <form (ngSubmit)="register()">
      <label for="register-username">New Username:</label>
      <input type="text" id="register-username" [(ngModel)]="username" name="newUsername" required />

      <label for="register-password">New Password:</label>
      <input type="password" id="register-password" [(ngModel)]="password" name="newPassword" required />

      <button type="submit">Sign Up</button>
    </form>
    <button (click)="isRegistering = false">Cancel</button>
  </div>

  <!-- Logged In Section -->
  <div *ngIf="userService.getLoggedInUser()">
    <h2>Welcome, {{ userService.getLoggedInUser() }}!</h2>

    <!-- Logout Button -->
    <button (click)="logout()">Logout</button>

    <!-- Profile Form -->
    <div class="profile-form">
      <!-- Skin Type -->
      <label for="skinType">Skin Type:</label>
      <select
        id="skinType"
        [(ngModel)]="userProfile.skinType"
        name="skinType"
        aria-label="Select your skin type"
      >
        <option [ngValue]="''">Select...</option>
        <option *ngFor="let t of skinTypes" [ngValue]="t">{{ t }}</option>
      </select>

      <!-- Skin Tone -->
      <label for="skinTone">Skin Tone:</label>
      <select
        id="skinTone"
        [(ngModel)]="userProfile.skinTone"
        name="skinTone"
        aria-label="Select your skin tone"
      >
        <option [ngValue]="''">Select...</option>
        <option *ngFor="let t of skinTones" [ngValue]="t">{{ t }}</option>
      </select>

      <!-- Hair Color -->
      <label for="hairColor">Hair Color:</label>
      <select
        id="hairColor"
        [(ngModel)]="userProfile.hairColor"
        name="hairColor"
        aria-label="Select your hair color"
      >
        <option [ngValue]="''">Select...</option>
        <option *ngFor="let c of hairColors" [ngValue]="c">{{ c }}</option>
      </select>

      <!-- Eye Color -->
      <label for="eyeColor">Eye Color:</label>
      <select
        id="eyeColor"
        [(ngModel)]="userProfile.eyeColor"
        name="eyeColor"
        aria-label="Select your eye color"
      >
        <option [ngValue]="''">Select...</option>
        <option *ngFor="let c of eyeColors" [ngValue]="c">{{ c }}</option>
      </select>

      <button (click)="saveProfile()">Save Profile</button>
    </div>

    <button (click)="goToQuiz()">Go to Quiz</button>
  </div>
</body>
</html>
